INSERT INTO `car_info` VALUES ('00000000000000000001', '1482160265383', '大众', null, null, '0', '25964', '1', null, '白色', '中国', '2016-12-19 00:00:00', '0', '1', '1', '<p>&nbsp; &nbsp;<span style=color: rgb(102, 102, 102); font-family: &quot;Microsoft Yahei&quot;; font-size: 14px; background-color: rgb(249, 249, 249);>虽然三四年迫击炮了，车况很好，正是好用的时候。公里数不算多，就跑了五万多公里。一直都是城市道路行驶，这辆车就是日常家用，上下班代步。一直都是在4S店做的保养，加装倒车影像系统、GPS导航。因个人原因出售爱车,炸弹雷管迫击炮有喜欢的朋友请尽快联系我吧，欢迎大家前来进行试驾，非诚勿扰呦。</span></p><p><span style=color: rgb(102, 102, 102); font-family: &quot;Microsoft Yahei&quot;; font-size: 14px; background-color: rgb(249, 249, 249);>&nbsp;&nbsp;&nbsp;&nbsp;<span style=color: rgb(102, 102, 102); font-family: &quot;Microsoft Yahei&quot;; font-size: 12px; background-color: rgb(249, 249, 249);>该车骨架完好，排除事故车，排除泡水车，排除火烧车，后部轻微追尾，轻微变形。</span></span></p><p><span style=color: rgb(102, 102, 102); font-family: &quot;Microsoft Yahei&quot;; font-size: 14px; background-color: rgb(249, 249, 249);>&nbsp;&nbsp;&nbsp;&nbsp;<span style=color: rgb(102, 102, 102); font-family: &quot;Microsoft Yahei&quot;; font-size: 14px; background-color: rgb(249, 249, 249);>这辆车买来刚不到一年，都是自己一直在用，内饰、外观都跟新车一样。用车的机会不多，开了一万多公里我的车平时就是城里开开，基本没跑过烂路。自家用车，正常使用。这车用的很爱惜，按时保养，整体车况还是不错的。加装倒车影像系统、GPS导航。准备换车了，所以出售此车。车况很好，欢迎喜欢的朋友来看车、试驾。</span></span></p>\';', null, '2016-12-19 23:11:05');
